// import logo from "../logo.svg";
import "../App.css";

class Main extends React.Component {
  state = {
    location: "Red Hat",
    city: "Banglore"
  };
  render() {
    return (
      <div>
        <h1 className="App-link">We are here</h1>
        <p>location : {this.state.location} @ </p>
      </div>
    );
  }
}

export default Main;
